    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge and Great Meadows National Wildlife Refuge summarizes refuge
    activities from May through August of 1956.  The report begins with general information
    about the yearu2019s weather conditions, water conditions, and fires.  Wildlife-
    including migratory birds, upland game birds, big game animals, fur animals, predaceous
    birds, and fish- is also covered.  The report includes a refuge development and
    maintenance section which discusses physical developments, plantings, collections,
    and receipts of seeds.  Economic uses of the refuge are outlined; haying and sand
    removal were the primary uses.   A progress report on field investigations is included.
     The public relations section of the report discusses public uses of the refuge,
    refuge visitors, refuge participation, hunting, fishing, and violations.  A summary
    is given for Great Meadows Refuge.  Finally, items of interest, photographs, and
    N-R forms are provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
